import Header from '../components/Header';
import Card from '../components/Card'

function Service() {
    return (
        <>
            <Header />
            <div className='container mx-auto'>
                <ul className='h-screen mx-8 mt-8 border-l-4 border-indigo-500'>
                    <Card />
                </ul>
            </div>
        </>
    )
}

export default Service;
